import * as React from 'react';
import { Button, TextField } from '@mui/material';
import Grid from '@mui/material/Grid';
import { useState } from 'react';


const Login = () => {

    const [values, setValues] = useState({
        username: "",
        password: "",
        showPassword: false,
        isLoggedIn: false
    });

    const showPasswordHandler = () => {
        setValues({...values, showPassword: !values.showPassword});
    };

    const mouseDownPasswordHandler = (event) => {
        event.preventDefault();
    };

    const passwordChangeHandler = (prop) => (event) => {
        setValues({...values, [prop]: event.target.value
        });
    };

    return(
        <div className='container'>
            <Grid container spacing={2}>
                <Grid item xs={4}>
                </Grid>
                <Grid item xs={4}>
                        <div 
                            className='header' 
                            style={{
                                display: 'flex',
                                justifyContent: 'center',
                                alignItems: 'center',
                                height: '20vh'
                            }}>
                            <h1>Find My News</h1>
                        </div>

                        <div className='inputs'>
                            <div className='input' style={{display: 'flex', justifyContent: 'center', alignItems: 'center', height: '10vh'}}>
                                <TextField id="outlined-basic" label="Username" variant="outlined" />
                            </div>
                            <div className='input' style={{display: 'flex', justifyContent: 'center', alignItems: 'center', height: '10vh'}}>
                                <TextField id="outlined-basic" label="Password" variant="outlined" password="true" />
                            </div>
                        </div>

                        <div className='login-container' style={{display: 'flex', justifyContent: 'center', alignItems: 'center', height: '10vh'}}>
                            <Button variant="contained">Log in</Button>
                        </div>
                </Grid>
                <Grid item xs={4}>
                </Grid>
            </Grid>
        </div>
    );
};
export default Login;
